import { ArrowDownward } from "@mui/icons-material";
import React from "react";
import "./Home.scss";

import PrimaryBtn from "../../components/PrimaryBtn";
import { PrimeBtnProp } from "../../components/PrimaryBtn";
const Home = () => {
  return (
    <div className="home">
      <div className="hero section">
        <h1>Explore to find inspiration for your next vacation</h1>
        <button>Explore</button>
        <span className="downArrow">
          <ArrowDownward sx={{ fontSize: 75 }} />
        </span>
      </div>
      <div className="suggestions section">
        <button className="btn">second section</button>
      </div>
      <div className="top-articles section">section 3</div>
      <div className="subscribe section">section 4</div>
    </div>
  );
};

export default Home;
